Улица:
Ледовый дворец и торгово-развлекательный центр "Сказка". Отличная транспортная доступность дополнит ваш комфорт: 
- Метро "Рассказовка" - всего в 2 минутах пешком; 
- Удобный выезд на Боровское шоссе для быстрого доступа к центру; 
- МКАД - до центра Москвы можно добраться примерно за 20 минут; 
- Международный аэропорт Внуково - всего в 5 км от комплекса. 
Не упустите возможность стать обладателем этой квартиры в одном из самых современных и комфортных комплексов Москвы! Свяжитесь с нами прямо сейчас для получения подробной информации - ваше новое жильё ждет вас!
